import {Box2, Frame} from "./MapStyles";

const Map= ()=> {
    return(
        <Box2>
            <Frame
                src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3145.2906522046997!2d23.649418314896486!3d37.97034577972432!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14a1bb7618ecfc9f%3A0x134eb821ff861f66!2sENERDATA%20ENTERPRISE%20SOLUTIONS!5e0!3m2!1sen!2sgr!4v1636409372183!5m2!1sen!2sgr">
            </Frame>
        </Box2>
    );
};
export default Map;
